text:
 @1lucasdp  "Segundo o relatório "Convocados", organizado pelo economista Cesar Grafietti, o time de Bragança só gastou menos que Flamengo na formação do elenco somando as temporadas de 2021 e 2022.

Foram R$ 298 milhões de investimento no elenco nesses dois anos, contra, por exemplo, R$ 134 milhões do São Paulo."

Não to conseguindo postar o link da matéria. Voce acha ela na ESPN.
